  R_names: null,
  paths: null,
  mapDialog: false,
  pagination: { page: 1, rowsPerPage: 12 },
});


onMounted(() => {
  Rtable.value.paths = document.querySelectorAll("path");
  const pathIds = [...Rtable.value.paths].map((path) =>
    path.getAttribute("data-id")
  );
  Rtable.value.R_names = [...Rtable.value.paths].map((path) =>
    path.getAttribute("name")
  );
  [...Rtable.value.paths].forEach((path, index) => {
    path.setAttribute("fill", `${colors[pathIds[index]].color}`);
    path.addEventListener("click", (e) => {
      Rtable.value.rows = candidates.map((i, n) =>
        fn_map_object(n, e.currentTarget.getAttribute("data-id"))
      );
      Rtable.value.region = e.currentTarget.getAttribute("name");
      Rtable.value.mapDialog = true;
      [...document.querySelectorAll(".region")].filter((item) =>
        item.innerText == Rtable.value.region ? item : null
      );
    });
  });
});




</script>

